import React from 'react';
import styled from 'styled-components';

const Footer = () => {
  return(
    <MainContainer>
      <div className='main'>
      </div>
    </MainContainer>
  )
}

export default Footer;

const MainContainer = styled.div`

  .main {
    background-color: black;
    height: 13vh;
    width: 100vw;
  }


`
